{
  "lockfile-version": 1,
  "manifest": {
    "version": 1,
    "install": {
      "binutils": {
        "pkg-path": "binutils"
      },
      "conda": {
        "pkg-path": "conda",
        "systems": [
          "aarch64-linux",
          "x86_64-linux"
        ]
      },
      "gcc": {
        "pkg-path": "gcc"
      },
      "gcloud": {
        "flake": "path:.flox/env/gcloud"
      },
      "gnumake": {
        "pkg-path": "gnumake"
      },
      "go": {
        "pkg-path": "go"
      },
      "kubectl": {
        "pkg-path": "kubectl"
      },
      "node-gyp": {
        "pkg-path": "node-gyp",
        "pkg-group": "node-gyp"
      },
      "nodejs_18": {
        "pkg-path": "nodejs_18"
      },
      "python3": {
        "pkg-path": "python311"
      },
      "terraform": {
        "pkg-path": "terraform"
      },
      "yarn": {
        "pkg-path": "yarn",
        "version": "1.22.22"
      },
      "zlib": {
        "pkg-path": "zlib"
      }
    },
    "vars": {
      "POPULUS_DATACENTER": "us",
      "POPULUS_ENVIRONMENT": "dev"
    },
    "hook": {
      "on-activate": "\n  # Install nodejs dependencies\n#  yarn\n\n  # Setup a Python virtual environment\n\n# make conda-create-env\n\n# conda-shell stuff should happen here?\n\n"
    },
    "profile": {
      "bash": "  echo \"Activating conda environment\" >&2\n  eval /home/jono/.conda/bin/conda \"shell.bash\" \"hook\" $argv | source\n\n  conda activate populus-env\n\n",
      "fish": "\n  echo \"Activating conda environment\" >&2\n  eval /home/jono/.conda/bin/conda \"shell.fish\" \"hook\" $argv | source\n\n  conda activate populus-env\n\n\tpython -V\n  pip -V\n\tconda -V\n\n  # install pdm here to avoid the \"Could not install packages due to an OSError: [Errno 30] Read-only file system: 'RECORD'\" when installed in [install]\n  #  also notice that I do it after loading conda so its in environment\n  #  otherwise it often works if I install it in nix globally\n\n  pip install pdm --quiet\n\t\n  pdm -V\n\n  echo READY\n\n  # if conda env not there, create it\n\n  # if node_modules no there, run yarn\n\n  if test ! -d \"$FLOX_ENV_PROJECT/node_modules\"\n    yarn\n  end\n\n"
    },
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    },
    "services": {
      "dbproxy": {
        "command": "make db-start-proxies",
        "vars": null,
        "is-daemon": null,
        "shutdown": null,
        "systems": null
      },
      "testdb": {
        "command": "make start-test-db",
        "vars": null,
        "is-daemon": null,
        "shutdown": null,
        "systems": null
      }
    }
  },
